commitMessage:
Add Location[Type/Code] support for Chassis/Storage

Chassis:

Remove getChassisLocationCode/ and use the common
location_util::getLocationCode for all resources to reduce duplicate
logic.

Also added supported to LocationType for Chassis with
location_util::getLocationType to determine the connection type of the
resource.

Storage:
Set the location type for StorageController as embedded since it is part
of the Storage.

Added supported to LocationCode + LocationType for Drive to
determine the location and connection type of the resource.

Tested:
Redfish Validator passed for Storage and Chassis.

Chassis Example
```
{
  "@odata.id": "/redfish/v1/Chassis/chassis0",
  "@odata.type": "#Chassis.v1_14_0.Chassis",
  "Actions": {
    "#Chassis.Reset": {
      "@Redfish.ActionInfo": "/redfish/v1/Chassis/board_0/ResetActionInfo",
      "target": "/redfish/v1/Chassis/warthog_1/Actions/Chassis.Reset"
    }
  },
  "ChassisType": "RackMount",
  "Id": "chassis0",
  "Links": {
    "ComputerSystems": [
      {
        "@odata.id": "/redfish/v1/Systems/system"
      }
    ],
    "ManagedBy": [
      {
        "@odata.id": "/redfish/v1/Managers/bmc"
      }
    ],
  },
  "Location": {
    "PartLocation": {
      "LocationType": "Slot",
      "ServiceLabel": "PEX"
    }
  },
...
}
```

Storage Example:
```
{
  "@odata.id": "/redfish/v1/Systems/system/Storage/1",
  "@odata.type": "#Storage.v1_7_1.Storage",
  ...
  "StorageControllers": [
    {
      "@odata.id": "/redfish/v1/Systems/system/Storage/1#/StorageControllers/0",
      "@odata.type": "#Storage.v1_7_0.StorageController",
      "MemberId": "cpld_1",
      "Name": "cpld_1",
      "Status": {
        "Health": "OK",
        "HealthRollup": "OK",
        "State": "Enabled"
      },
      "PartLocation": {
        "LocationType": "Embedded"
      }
    }
  ]
}
```

