comments.message:
Please take a look at how we generally write these.  We try to avoid the json_pointer thing.  Return the translated interface into the calling scope, and let the calling scope both deal with errors and figure out where to put this in the tree

something like

std::string locationType = getLocationType(interface);
if (locationType.empty()){
   internal error....
}
asyncResp->res[Location] = locationType;

This keeps the method calls simple, and gives each handler the ability to manage its own errors, which tend to be different.

this is the only place where I am getting both LocationCode and LocationType right now.

Maybe in the helper file we can have,

findLocation(const std::shared_ptr<bmcweb::AsyncResp>& asyncResp,
             const std::string& path, const std::string& service,
             const std::vector<std::string>& interfaces,
             const nlohmann::json_pointer<nlohmann::json>& location)

and we can use that instead.

But in some cases, this will force us to loop the interfaces list twice(if there is already a loop lik in https://gerrit.openbmc-project.xyz/c/openbmc/bmcweb/+/51879/4). Maybe that's fine.

All the call sites for the location helpers look like:

```
if (interface == "...LocationCode") { getLocationCode(...); }
else if (isConnector(interface)) { getLocationType(...); ... }
```

If you make a findLocation/getLocation function, why not pass in `interface` explicitly to avoid the repeated loop?
